import React from "react";
import carServices from "../services/carServices";
import {Link, useSearchParams} from 'react-router-dom';
import {useState, useEffect} from 'react';
import axios from "axios";

class AddCarComponent extends React.Component {


    render() {
        return(
            <>
            <header>
            <h1>AutoShow.by</h1>
            <hr></hr> 
            <ul>
                <li><Link to="/cars">Каталог автомобилей</Link></li>
                <li><Link to={`cars/`}>Клиенты</Link></li>
                <li><Link to={`cars/`}>Продажи</Link></li>
            </ul>
            </header>
            <form>
                <label>Brand</label>
                <input type="text"/>
                <label>Model</label>
                <input type="text"/>
                <label>Year Release</label>
                <input type="text"/>
            </form>
            </>
        )
    }
}

export default AddCarComponent
